/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `CALCULAR_NETO_BI` BEFORE INSERT ON `TICKETS` FOR EACH ROW BEGIN
	
    
    DECLARE PRECIO DECIMAL(10,2);
	SELECT CALCULAR_PRECIO_TICKET(NEW.IDCLIENTE) INTO PRECIO;
    SET NEW.IMPORTE=PRECIO;
    
    
    
    IF NEW.TARAPESO <> 0 AND NEW.BRUTOPESO <> 0 THEN
        SET NEW.NETO = NEW.BRUTOPESO - NEW.TARAPESO;
        SET NEW.PENDIENTE=0;
    ELSE
        SET NEW.NETO = 0;
        SET NEW.PENDIENTE=1;
    END IF;
END */;;
DELIMITER ;
