CREATE DEFINER=`root`@`localhost` FUNCTION `CALCULAR_PESO_NETO`(TICKET INT) RETURNS int
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE NETO INT;
    DECLARE BRUTO INT;
    DECLARE TARA INT;
    
    SELECT BRUTOPESO, TARAPESO INTO BRUTO, TARA
    FROM TICKETS TI
    WHERE TI.IDTICKET = TICKET;
    
    IF TARA=0 OR BRUTO=0 THEN 
		SET NETO = TARA;
    ELSE
		SET NETO = BRUTO-TARA;
    END IF;   
        
    RETURN NETO;
END ;;
DELIMITER ;
