CREATE DEFINER=`root`@`localhost` FUNCTION `CALCULAR_PRECIO_TICKET`(CLIENTEID INT) RETURNS decimal(10,0)
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE PRECIO DECIMAL;
    SELECT CO.PRECIO INTO PRECIO
    FROM CONDICION CO
    LEFT JOIN CLIENTES CL
    ON CO.IDCONDICION=CL.IDCONDICION
    WHERE CL.IDCLIENTE = CLIENTEID;
    RETURN PRECIO;
END ;;
