CREATE DEFINER=`root`@`localhost` FUNCTION `CONTAR_TICKET_PENDIENTES_CLIENTE`(CLIENTE_ID INT, F_INICIO DATETIME, F_FIN DATETIME) RETURNS int
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE Q_PENDIENTES INT;
    
    SELECT COUNT(*) INTO Q_PENDIENTES
    FROM TICKETS
    WHERE IDCLIENTE = CLIENTE_ID
    AND FECHA >= F_INICIO
    AND FECHA <= F_FIN
    AND PENDIENTE=0;
    
    RETURN Q_PENDIENTES;
END ;;
