    IN O_NOMBRE VARCHAR(100),
    IN O_TELEFONO VARCHAR(20),
    IN O_CORREO VARCHAR(100),
    IN O_IDEMPRESA INT
)
BEGIN
    DECLARE EMPRESA INT;
    
    
    SELECT COUNT(*) INTO EMPRESA
    FROM EMPRESA
    WHERE IDEMPRESA = O_IDEMPRESA;
    
